using Data.Access;
using Microsoft.AspNetCore.Mvc;
using Models;

namespace MyInternetSpeed.Controllers
{
    [Route("[controller]")]
    [ApiController]
    public class FileShareController : Controller
    {
        
        private readonly byte[] TestFileBytes = Convert.FromBase64String(
            "");

        [HttpGet("download-test-file")]
        public IActionResult DownloadTestFile()
        {
            try
            {
                return File(TestFileBytes, "application/octet-stream", "test-file.bin");
            }
            catch (Exception)
            {
                return StatusCode(500, "Error fetching download test file");
            }
        }
    }
}